import React from "react"

import { ProductsBlock } from './index'

function Search(params) {
    return (  
      <div className="search-block">
      2
      </div>
    )
}

function AboutProducts({items}) {
  return (
    <div className="block-cards">
        {
          items.map((obj) => 
          <ProductsBlock 
          key = {obj.id}
          {...obj}/>)
        }
    </div>
  )
}

export default AboutProducts
